class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

class Solution:
    def plusOne(self, l: ListNode) -> ListNode:
        dummy = ListNode(0)
        dummy.next = l
        carry = 0
        curr = dummy

        while curr.next:
            val = curr.next.val + carry
            carry, curr.next.val = divmod(val, 10)
            curr = curr.next

        if carry > 0:
            curr.next = ListNode(carry)

        return dummy.next
